import React from "react"

const Warning = () => {
	return (
		<>
			<h1 style={{ marginTop: "50px" }}>Внимание!</h1>
			<p>Что-то пошло не так, проверьте соединение с интернетом...</p>
		</>
	)
}

export default Warning;
